package dev.yafatek.apptests;public class RestModel {	private Long id;	private String message;	private boolean status;	public RestModel(Long id, String message, boolean status) {		this.id = id;		this.message = message;		this.status = status;	}	public RestModel() {	}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getMessage() {		return message;	}	public void setMessage(String message) {		this.message = message;	}	public boolean isStatus() {		return status;	}	public void setStatus(boolean status) {		this.status = status;	}}